/* eslint-disable max-len */
import {Interface} from 'ethers'
import {
    decodeOutputForMulticall,
    decodeOutputForMulticallWithGas,
    decodeOutputForMulticallWithGasLimitation
} from './decode'
import ABI from '../abi/MultiCall.abi.json'

const iface = new Interface(ABI)

describe('MulticallDecoder', () => {
    it('should decode multicallWithGasLimitation output', () => {
        const [results, lastSuccessIndex] = iface.decodeFunctionResult(
            'multicallWithGasLimitation',
            outputWithGasLimitation
        )
        const actual = decodeOutputForMulticallWithGasLimitation(outputWithGasLimitation)

        expect(actual).toEqual({results, lastSuccessIndex})
    })

    it('should decode multicallWithGas output', () => {
        const [results, gasUsed] = iface.decodeFunctionResult('multicallWithGas', outputMulticallWithGas)
        const actual = decodeOutputForMulticallWithGas(outputMulticallWithGas)

        expect(actual).toEqual({results, gasUsed})
    })

    it('should decode multicall output', () => {
        const [results] = iface.decodeFunctionResult('multicall', outputMulticall)
        const actual = decodeOutputForMulticall(outputMulticall)

        expect(actual).toEqual(results)
    })
})

const outputWithGasLimitation =
    ''

const outputMulticallWithGas =
    ''

const outputMulticall =
    ''
